<script>
export default {
  data () {
    return {
      fullscreen: false,
      isCollapse: false,
      menuList: [
        {
          id: 9,
          name: '主节点托管',
          path: '',
          icon: 'icon-service',
          children: [
            { id: 57, name: '区块货币列表', path: '/home/coinsList' },
            { id: 58, name: '主节点列表', path: '/home/masternodeList' }
          ]
        }
      ]
    }
  },
  computed: {
    nowMenuList() {
      // console.log(this.menuList);
      let list = [];
      for (let i = 0; i < this.menuList.length; i++) {
        for (let j = 0; j < this.menuList[i].children.length; j++) {
          // console.log(this.menuList[i])
          if (this.menuList[i].children[j].path === this.$route.path) {
            list.push(this.menuList[i].name)
            list.push(this.menuList[i].children[j].name)
          }
        }
      }
      // console.log(list);
      // return this.$route.path;
      return list
    }
  },
  methods: {
    logout () {
      console.log('退出登录')
      this.$router.push({ name: 'login' })
      this.$store.dispatch('user/log_out')
    },
    shrink () {
      this.isCollapse = !this.isCollapse
      // console.log(this.$route.path);
      // console.log(this.$router);
    },
    // 全屏
    handleFullScreen () {
      let element = document.documentElement
      if (this.fullscreen) {
        if (document.exitFullscreen) {
          document.exitFullscreen()
        } else if (document.webkitCancelFullScreen) {
          document.webkitCancelFullScreen()
        } else if (document.mozCancelFullScreen) {
          document.mozCancelFullScreen()
        } else if (document.msExitFullscreen) {
          document.msExitFullscreen()
        }
      } else {
        if (element.requestFullscreen) {
          element.requestFullscreen()
        } else if (element.webkitRequestFullScreen) {
          element.webkitRequestFullScreen()
        } else if (element.mozRequestFullScreen) {
          element.mozRequestFullScreen()
        } else if (element.msRequestFullscreen) {
          // IE11
          element.msRequestFullscreen()
        }
      }
      this.fullscreen = !this.fullscreen
    }
  }
}
</script>
